import React from 'react';
import logo from "../img/logo.png";

export default function Navbar() {
    return <div className="navbar">
        <img src={logo} alt="" />
        <ul className="nav-menu">
            <li></li>
            <li></li>
            
        </ul>
    </div>;
}
